import React, {useEffect, useState} from 'react';
import Select from 'react-select';
import axios, {AxiosResponse} from 'axios';
import '../App.css';
import ModalAddFlower from "../Modal/modalAddFlower";
import {Navigate, useNavigate} from "react-router-dom";


interface City {
    id: string;
    name: string;
    coordinates: Coordinates;
    creationDate: Date;
    area: number;
    population: number;
    metersAboveSeaLevel: number;
    capital: boolean;
    government: Government;
    governor: Human;
}

interface Coordinates {
    x: number;
    y: number;
}

enum Government {
    "DESPOTISM",
    "PATRIARCHY",
    "ETHNOCRACY",
}

interface Human{
    height: number;
    birthday: Date;
}

const FlowerTable: React.FC = () => {
        const navigate = useNavigate();
        const [id, setId] = useState('');
        const [name, setName] = useState('');
        const [coordinates, setCoordinates] = useState<Coordinates[]>([]);
        const [creationDate, setCreationDatee] = useState('');
        const [area, setArea] = useState('');
        const [population, setPopulation] = useState('');
        const [metersAboveSeaLevel, setMetersAboveSeaLevel] = useState('');
        const [capital, setCapital] = useState('');
        const [government, Government] = useState<Government[]>([]);
        const [governor, setGovernor] = useState<Human[]>([]);
        const [x, setX] = useState('');
        const [y, setY] = useState('');
        const [height, setHeight] = useState('');
        const [birthday, setBirthday] = useState('');
        const [cityList, setCityList] = useState<City[]>([]);


        const fetchData = async () => {
            try {
                const response: AxiosResponse<{ cityList: City[] }> = await axios.get(
                    'http://localhost:8080/api/city',
                    {
                        headers: {'Access-Control-Allow-Origin': '*'},
                    }
                );
                console.log(response);
                setCityList(response.data.cityList);
                response.data.cityList.map((res, index) => {
                    const foundOption = cityList.findIndex(a => a.id === res.id);
                    if (foundOption === -1) {
                        cityList.push(res);
                    } else {
                        cityList[foundOption].name = res.name;
                        cityList[foundOption].coordinates = res.coordinates;
                        cityList[foundOption].creationDate = res.creationDate;
                        cityList[foundOption].area = res.area;
                        cityList[foundOption].population = res.population;
                        cityList[foundOption].metersAboveSeaLevel = res.metersAboveSeaLevel;
                        cityList[foundOption].capital = res.capital;
                        cityList[foundOption].government = res.government;
                    }
                    setCityList(cityList);
                })
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };

        useEffect(() => {
            fetchData()

        }, []);

        return (
            <div className="body">
                <br/>
                <table className="selection">
                    <thead>
                        <tr>
                            <th>
                                <p>Получить город по id</p>
                                <input></input>
                                <button className='add'>Получить</button>
                            </th>
                            <th>
                                <input></input>
                                <button className='add'>Обновить город по id</button>
                            </th>
                            <th>
                                <input></input>
                                <button className='add'>Удалить город по id</button>
                            </th>
                            <th>
                                <button className='add'>Получить города с пагинацией</button>
                            </th>
                            <th>
                                <button className='add'>Город с минимальным id</button>
                            </th>
                            <th>
                                <button className='add'>Город с максимальной датой</button>
                            </th>
                            <th>
                                <input></input>
                                <button className='add'>Город с government меньше заданного</button>
                            </th>
                        </tr>
                    </thead>
                </table>
                <div className="container">


                    <table className="flower">
                        <thead>
                        <tr>
                            <th>Название</th>
                            <th>Коордианты</th>
                            <th>Площадь</th>
                            <th>Население</th>
                            <th>Высота над уровнем моря</th>
                            <th>Тип правительства</th>
                            <th>Мэр</th>
                            <th></th>
                        </tr>
                        </thead>
                        <tbody>
                        {
                            cityList.map((city, index) => (
                                <tr key={city.id}>
                                    <td>{city.name}</td>
                                    <td>{city.coordinates.x};{city.coordinates.y}</td>
                                    <td>{city.area}</td>
                                    <td>{city.population}</td>
                                    <td>{city.metersAboveSeaLevel}</td>
                                    <td>{city.government}</td>
                                    <td>{city.governor.height}</td>       
                                    <td>
                                        <img src={require("../Image/delete.svg").default} onClick={async () => {
                                            setId(city.id);
                                            try {
                                                const response = await fetch(`http://localhost:8081/api/city/city?cityID=${city.id}`, {
                                                    method: 'DELETE',
                                                    headers: {
                                                        'Content-Type': 'application/json'
                                                    }
                                                });

                                                if (response.ok) {
                                                    delete cityList[index];
                                                    fetchData();
                                                } else {
                                                    throw new Error(`HTTP error! Status: ${response.status}`);
                                                }

                                                const data = await response.json();
                                                return data;
                                            } catch (e) {
                                                console.log('Sending error', e);
                                            }
                                        }}/>
                                    </td>
                                </tr>
                            ))}
